import React, { Component } from 'react';
import { Widget } from 'react-chat-widget';
 
// import 'react-chat-widget/lib/styles.css';
import "../../node_modules/react-chat-widget/lib/"
 
class App extends Component {
  render() {
    return (
      <div className="App">
        <Widget />
      </div>
    );
  }
}
 
export default App;
